import React from 'react';
import logo from '../img/logo.png'

class Header extends React.Component {

    render() {
        return (
            <div id="header">
                <img src={logo} alt="logo"/>
                <div id="name">
                    Purdue Building
                </div>
            </div>)
    }
}

export default Header
